const title=document.title,links=document.querySelectorAll(".navbar a");links.forEach((link,i)=>{link.addEventListener("click",()=>{let clickLink=link.children[1].innerHTML;document.title=`${title}'s - ${clickLink.charAt(0).toUpperCase()+clickLink.slice(1)}`})}),setInterval(()=>{document.title=title},3e4);let workLoadMoreBtn=document.getElementById("workLoadMore"),currentWork=3;workLoadMoreBtn.addEventListener("click",()=>{let boxes=[...document.querySelectorAll(".portfolio .box-container .box")];for(let i=currentWork;i<currentWork+3;i++)boxes[i].style.display="inline-block";currentWork+=3,currentWork>=boxes.length&&(workLoadMoreBtn.style.display="none")});let blogLoadMoreBtn=document.getElementById("blogLoadMore"),currentBlog=3;blogLoadMoreBtn.addEventListener("click",()=>{console.log();let boxes=[...document.querySelectorAll(".blogs .box-container .box")];for(let i=currentBlog;i<currentBlog+3;i++)boxes[i].style.display="inline-block";currentBlog+=3,currentBlog>=boxes.length&&(blogLoadMoreBtn.style.display="none")});let typed=new Typed("#inputFromJS",{strings:["SEO Developer ","Digital Marketer"],typeSpeed:100,backSpeed:50,loop:!0});